import React, { Component } from 'react';

class Logo extends Component
{
    render()
    {
        return (
            <span className="header-brand">
            <img className="logo" alt="logo" src="https://www.clipartkey.com/mpngs/m/284-2846769_source-code-icon-transparent-png-coding-logos.png"/>
        </span>
        );
    }
}

export default Logo;
